package inheritance;

public class Childs  {
	public void car() {
		System.out.println("BMW");
		}
	public void fruits() {
		System.out.println("apple");
	}
	

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Childs c=new Childs();
		c.car();
		c.fruits();

	}

}
